q($,"aOb","asx",function(){return H.a([N.cX("Coronaviruses are a large family of viruses which may cause illness in animals or humans.  In humans, several coronaviruses are known to cause respiratory infections ranging from the common cold to more severe diseases such as Middle East Respiratory Syndrome (MERS) and Severe Acute Respiratory Syndrome (SARS). The most recently discovered coronavirus causes coronavirus disease COVID-19.","What is a coronavirus?"),N.cX("COVID-19 is the infectious disease caused by the most recently discovered coronavirus. This new virus and disease were unknown before the outbreak began in Wuhan, China, in December 2019.","What is COVID-19?"),N.cX("The most common symptoms of COVID-19 are fever, tiredness, and dry cough. Some patients may have aches and pains, nasal congestion, runny nose, sore throat or diarrhea. These symptoms are usually mild and begin gradually. Some people become infected but don\u2019t develop any symptoms and don't feel unwell. Most people (about 80%) recover from the disease without needing special treatment. Around 1 out of every 6 people who gets COVID-19 becomes seriously ill and develops difficulty breathing. Older people, and those with underlying medical problems like high blood pressure, heart problems or diabetes, are more likely to develop serious illness. People with fever, cough and difficulty breathing should seek medical attention.","What are the symptoms of COVID-19?"),N.cX("People can catch COVID-19 from others who have the virus. The disease can spread from person to person through small droplets from the nose or mouth which are spread when a person with COVID-19 coughs or exhales. These droplets land on objects and surfaces around the person. Other people then catch COVID-19 by touching these objects or surfaces, then touching their eyes, nose or mouth. People can also catch COVID-19 if they breathe in droplets from a person with COVID-19 who coughs out or exhales droplets. This is why it is important to stay more than 1 meter (3 feet) away from a person who is sick.","How does COVID-19 spread?"),N.cX("Studies to date suggest that the virus that causes COVID-19 is mainly transmitted through contact with respiratory droplets rather than through the air.  See previous answer on \u201cHow does COVID-19 spread?\u201d","Can COVID-19 be transmitted through air?"),N.cX("The main way the disease spreads is through respiratory droplets expelled by someone who is coughing. The risk of catching COVID-19 from someone with no symptoms at all is very low. However, many people with COVID-19 experience only mild symptoms. This is particularly true at the early stages of the disease. It is therefore possible to catch COVID-19 from someone who has, for example, just a mild cough and does not feel ill.","Can COVID-19 be caught from a person who has no symptoms?"),N.cX("The risk of catching COVID-19 from the feces of an infected person appears to be low. While initial investigations suggest the virus may be present in feces in some cases, spread through this route is not a main feature of the outbreak. WHO is assessing ongoing research on the ways COVID-19 is spread and will continue to share new findings. Because this is a risk, however, it is another reason to clean hands regularly, after using the bathroom and before eating.","Can I catch COVID-19 from the feces of someone with the disease?"),N.cX('Stay aware of the latest information on the COVID-19 outbreak, available on the WHO website and through your national and local public health authority. Many countries around the world have seen cases of COVID-19 and several have seen outbreaks. Authorities in China and some other countries have succeeded in slowing or stopping their outbreaks. However, the situation is unpredictable so check regularly for the latest news. Check "Prevention" tab on Home for more Information',"What can I do to protect myself and prevent the spread of disease?"),N.cX("The risk depends on where you  are - and more specifically, whether there is a COVID-19 outbreak unfolding there.\nFor most people in most locations the risk of catching COVID-19 is still low. However, there are now places around the world (cities or areas) where the disease is spreading. For people living in, or visiting, these areas the risk of catching COVID-19 is higher. Governments and health authorities are taking vigorous action every time a new case of COVID-19 is identified. Be sure to comply with any local restrictions on travel, movement or large gatherings. Cooperating with disease control efforts will reduce your risk of catching or spreading COVID-19.","How likely am I to catch COVID-19?"),N.cX("Illness due to COVID-19 infection is generally mild, especially for children and young adults. However, it can cause serious illness: about 1 in every 5 people who catch it need hospital care. It is therefore quite normal for people to worry about how the COVID-19 outbreak will affect them and their loved ones.\nWe can channel our concerns into actions to protect ourselves, our loved ones and our communities. First and foremost among these actions is regular and thorough hand-washing and good respiratory hygiene. Secondly, keep informed and follow the advice of the local health authorities including any restrictions put in place on travel, movement and gatherings.","Should I worry about COVID-19?"),N.cX("While we are still learning about how COVID-2019 affects people, older persons and persons with pre-existing medical conditions (such as high blood pressure, heart disease, lung disease, cancer or diabetes)  appear to develop serious illness more often than others.","Who is at risk of developing severe illness?"),N.cX("No. Antibiotics do not work against viruses, they only work on bacterial infections. COVID-19 is caused by a virus, so antibiotics do not work. Antibiotics should not be used as a means of prevention or treatment of COVID-19. They should only be used as directed by a physician to treat a bacterial infection.","Are antibiotics effective in preventing or treating the COVID-19?"),N.cX("While some western, traditional or home remedies may provide comfort and alleviate symptoms of COVID-19, there is no evidence that current medicine can prevent or cure the disease. WHO does not recommend self-medication with any medicines, including antibiotics, as a prevention or cure for COVID-19. However, there are several ongoing clinical trials that include both western and traditional medicines.","Are there any medicines or therapies that can prevent or cure COVID-19?"),N.cX("Not yet. To date, there is no vaccine and no specific antiviral medicine to prevent or treat COVID-2019. However, those affected should receive care to relieve symptoms. People with serious illness should be hospitalized. Most patients recover thanks to supportive care.","Is there a vaccine, drug or treatment for COVID-19?"),N.cX("No. The virus that causes COVID-19 and the one that caused the outbreak of Severe Acute Respiratory Syndrome (SARS) in 2003 are related to each other genetically, but the diseases they cause are quite different.\nSARS was more deadly but much less infectious than COVID-19. There have been no outbreaks of SARS anywhere in the world since 2003.","Is COVID-19 the same as SARS?"),N.cX("Only wear a mask if you are ill with COVID-19 symptoms (especially coughing) or looking after someone who may have COVID-19. Disposable face mask can only be used once. If you are not ill or looking after someone who is ill then you are wasting a mask. There is a world-wide shortage of masks, so WHO urges people to use masks wisely.","Should I wear a mask to protect myself?"),N.cX("The \u201cincubation period\u201d means the time between catching the virus and beginning to have symptoms of the disease. Most estimates of the incubation period for COVID-19 range from 1-14 days, most commonly around five days. These estimates will be updated as more data become available.","How long is the incubation period for COVID-19?"),N.cX("There is a possibility for some animals to become infected through close contact with infected humans. Further evidence is needed to understand if animals and pets can spread the disease.\nBased on current evidence, human to human transmission remains the main driver.","Can I catch COVID-19 from my pet?"),N.cX("It is not certain how long the virus that causes COVID-19 survives on surfaces, but it seems to behave like other coronaviruses. Studies suggest that coronaviruses (including preliminary information on the COVID-19 virus) may persist on surfaces for a few hours or up to several days. This may vary under different conditions (e.g. type of surface, temperature or humidity of the environment).","How long does the virus survive on surfaces?"),N.cX("Yes. The likelihood of an infected person contaminating commercial goods is low and the risk of catching the virus that causes COVID-19 from a package that has been moved, travelled, and exposed to different conditions and temperature is also low.","Is it safe to receive a package from any area where COVID-19 has been reported?"),N.cX("There is currently no evidence to confirm or disprove that COVID-19 virus can be transmitted through coins or banknotes. However, respiratory droplets expelled from an infected person can contaminate and persist on surfaces. Wash your hands regularly and thoroughly after touching any frequently-touched surface or object, including coins or banknotes. Avoid touching your eyes, mouth and nose, if your hands are not cleaned.","Can COVID-19 be spread through coins and banknotes?"),N.cX("When grocery shopping, keep at least 1-metre distance from others and avoid touching your eyes, mouth and nose. If possible, sanitize the handles of shopping trolleys or baskets before shopping. Once home, wash your hands thoroughly and also after handling and storing your purchased products. There is currently no confirmed case of COVID-19 transmitted through food or food packaging.","How can I grocery shop safely in the time of COVID-19?"),N.cX("Fruits and vegetables are essential components of a healthy diet. Wash them the same way you would in any other circumstance. Before handling them, wash your hands with soap and water. Then, wash fruits and vegetables thoroughly with clean water, especially if you eat them raw.","How to wash fruits and vegetables in the time of COVID-19?")],H.ag("x<pH*>"))})
q($,"aOi","asy",function(){return H.a([N.db("No, antibiotics do not work against viruses, only bacteria. The new coronavirus (2019-nCOV) is a virus, therefore, antibiotics should not be used. However, if you are hospitalised for the 2019-nCOV, you may recieve antibiotics since bacterial co-infection is possible","Antibiotics are effective in treating and preventing the new coronavirus?"),N.db('The "Incubation period" means the time between catching the virus and beginning to have symptoms of the disease. Most estimates of the incubation period for COVID-19 range from 1-14 days',"The Incubation preiod is up to 5 days"),N.db("Holding your breath for more than 10 seconds without discomfort doeos not prove whether you are infected or not","If you can hold your breath for 10 seconds without discomfort, you don't have COVID-19"),N.db("While there has been instances of some animals, there is no evidence that dog, cat or any pet can transmit COVID-19","I can catch COVID-19 from my pet"),N.db("Regular intake of Vitamin-C boosts immunity. However, excessive intake is not recommended","Heavy intake of Vitamin-C can help in curing corona infection"),N.db("People of all ages can be infected by the new coronavirus (nCov-2019). Older people, and people with pre-existing medical conditions (such as asthma, diabetes, heart disease) appear to be more vulnerable","The new coronavirus affect older people"),N.db("There is no such treatment","A viral post on social media claims that bitter groud juice can treat coronavirus"),N.db("There is no scientific evidence to support this claim","A moist throat can ensure protection from corona infection"),N.db("According to WHO, there is no evidence to prove that sunlight kills the new coronavirus","Sunlight can kill the new coronavirus"),N.db("No, inhaling steam doesn't kill the coronavirus. Repsiratory hygiene, social distancing and washing hands are the effective measures to prevent COVID-19.","Inhaling steam from hot water kills the coronavirus"),N.db("Given its novelty, it hasn't been proven yet if it gets destroyed in high temperature or not. Preventive measures must be followed until any further information is confirmed","Coronavirus gets automatically destoryed in High temperature"),N.db("Drinking alcohol doesn't protect one from COVID-19 and can be dangerous for one's health","Drinking alcohol protects one against COVID-19!"),N.db("COVID-19 doesn't spread from mosquite bite but through droplets spread when an infected person sneezes","Mosquito bites get one infected with COVID-19"),N.db("It helps against pneumonia but doesn't have a protective effective against coronavirus","Getting the pneumonia vaccine, protects one against the virus"),N.db("The virus lives inside the body where the temperature is maintained at 37\xb0 & is not affected by the hot water bath","Having bath with hot water kills the virus"),N.db("WHO hasn't released any advisory regarding the same","WHO has advised against eating bakery items as they get infected with virus easily"),N.db("There is no evidence that regularly rinsing the nose with saline has protected people from infection with the coronavirus","Regularly rinsing the nose with saline help prevent infection with the coronavirus"),N.db("There is no reason to believe that cold weather can kill the coronavirus","Cold weather and snow can kill the coronavirus"),N.db("There's no such evidence that eating food cooked from mustard oil will protect you against coronavirus","Eating food cooked in mustard oil will protect you against coronavirus"),N.db("No. Spraying alcohol or chlorine all over your body will not kill viruses that have already entered your body","Spraying alcohol or chlorine all over your body can kill coronavirus"),N.db("UV lamps should not be used to steralize hands or other areas of skin as UV radiation can cause skin irritation","An ultraviolent disinfection lamp can kill coronavirus"),N.db("Viruses cannot travel on radio/mobile networks. COVID-19 is spreading in many countries that do not have 5G mobile networks.","5G Mobile networks spread COVID-19")],t.kd)})
